// eBlasts Controller
angular.module('ttc')
.controller('eBlastsCtrl', ['$scope', '$http', 'UserService', '$window', '$log', 
function ($scope, $http, UserService, $window, $log) 
	{
	var request = {method: 'POST', url: '/api/get-eblasts', headers: {'x-auth': UserService.getToken ()}};
	
	$scope.busyPromise = $http(request);
	$scope.busyPromise.then(
			function (response) {
				response.data.sort(function (a, b) {if (a.date < b.date) return 1; else if (a.date > b.date) return -1; else return 0;});
				$scope.emails = response.data;
			}
		)
		.catch(
			function (response) {
				$window.alert (response.data + ' - please contact the TTC Webmaster');
			}
		)
}]);

"use strict";

// Controller for the main Index.html page
angular.module('ttc')
.controller ('IndexController',['$scope', 'UserService', '$modal', '$log', 'deviceDetector', function ($scope, UserService, $modal, $log, deviceDetector) {
		$scope.user 	= UserService;
		$scope.device	= deviceDetector;
		
		// Opens the modals
		$scope.open = function (whichSize, whichModal, whichController) {
			$log.info ('Open Modal');
			var modalInstance = $modal.open({
				templateUrl: whichModal,
				controller: whichController,
				size: whichSize,
				backdrop: true,
				resolve: {}
			});

			modalInstance.result.then(function () {
				$log.info ('Modal closed at: ' + new Date());
			}, function () {
				$log.info ('Modal dismissed at: ' + new Date());
			});
		};
	}
]);
